INSERT INTO `resource` (`id`, `resource_name`, `place_id`, `device`, `capacity`, `other`) VALUES
(1, '会议室', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">一、申请使用必须为校内正式单位和学生组织。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、请申请者提前在办公时间到团委办公室出示申请通过界面，在赵静老师处领取钥匙。（备注：领取钥匙的同学须抵押本人学生证或一卡通。）</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、如有疑问，请及时联系团委办公室82668265。</span>\n</p>\n<p>\n    <span style=\"font-size:16px;line-height:120%;font-family:宋体;color:#333333;background:white\">六、如与团委临时重要活动冲突，团委优先使用</span>\n</p>\n<p>\n    <br/>\n</p>'),
(2, '青年之家', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span>\n</p>\n<p style=\"margin-left:0;text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family:宋体;color:#333333\"></span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">一、申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、活动规模超过200人的，必须OA办理大型活动审批。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、申请及使用时，请务必提前和团委联系。 梁老师 齐老师82668265</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>\n<p style=\"margin-left:0;text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-size:16px;line-height:120%;font-family:宋体;color:#333333;background:white\"></span><br/>\n</p>\n<p>\n    <br/>\n</p>'),
(3, '宪梓堂', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span>\n</p>\n<p style=\"margin-left:0;text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family:宋体;color:#333333\">一、</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、活动规模原则上必须符合大型活动要求，并在OA办理大型活动审批。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。（可以在申请后或通过如取消活动）</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产，严禁私接及随意使用场内各类设备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、<strong>申请及使用时，请务必提前和团委联系。</strong> 梁老师 齐老师82668265</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-size:16px;line-height:120%;font-family:宋体;color:#333333;background:white\"></span><br/>\n</p>\n<p>\n    <br/>\n</p>'),
(4, '团委投影仪', 1, 1, 0, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 14px; font-family: 宋体;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p style=\"text-indent: 19px; text-align: center;\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">周一至周五（19：00-22:00）<br/></span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">周六周日（8:30-11:30,14:30-17:30,19:00-22:00）</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">一、申请使用团队必须为学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">二、预约信息务必填写完整，准确</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">三、如果取消或变更预约申请，请及时联系团委办公室82668564 &nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">四、使用投影仪时请保证仪器的完整性和完好性，如有损坏原价赔偿。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、请申请者提前在办公时间（冬季：8:00-12:00，2:00-6:00，夏季：8:00-12:00,2:30-6:30）到团委1号办公室任老师处领取投影仪。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">备注：领取投影仪的同学须抵押本人一卡通，于投影仪归还时领回。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">六，如与团委活动冲突，团委活动优先使用。</span>\r\n</p>'),
(5, '科技及媒体类社团公共空间', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">一、申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、请申请者使用时向值班人员出示申请通过界面。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、如有疑问，请及时联系团委办公室82668564。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span><br/>\n</p>\n<p>\n    <br/>\n</p>'),
(6, '505体育馆', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span>\n</p>\n<p style=\"margin-left:0;text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family:宋体;color:#333333\">一、</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、活动规模原则上必须符合大型活动要求，并在OA办理大型活动审批。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。（可以在申请后或通过如取消活动）</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产，严禁私接及随意使用场内各类设备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、<strong>申请及使用时，请务必提前和团委联系。</strong> 梁老师 齐老师82668265</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-size:16px;line-height:120%;font-family:宋体;color:#333333;background:white\"></span><br/>\n</p>\n<p>\n    <br/>\n</p>'),
(7, '思源南厅', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">一、申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、请申请者使用时向值班人员出示申请通过界面。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、如有疑问，请及时联系团委办公室82668564。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span><br/>\n</p>\n<p>\n    <br/>\n</p>'),
