(10, '思源东侧二楼排练厅', 1, 0, 1000, '<p style=\"text-align:center;text-indent:19px\">    <span style=\"font-size: 14px; font-family: 宋体;\"></span></p><p style=\"text-align:center;text-indent:19px\">    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span></p><p style=\"text-align:center;text-indent:19px\">    <span style=\"font-size: 18px;\"><span style=\"font-family: 宋体; color: red;\">周一至周五（</span><span style=\"color: red;\">19</span><span style=\"font-family: 宋体; color: red;\">：</span><span style=\"color: red;\">00-22:00</span><span style=\"font-family: 宋体; color: red;\">）</span></span></p><p style=\"text-align:center;text-indent:19px\">    <span style=\"font-size: 18px;\"><span style=\"font-size: 19px; font-family: 宋体; color: red;\">周六周日（</span><span style=\"font-size: 19px; color: red;\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span></span></p><p style=\"text-indent:19px\">    <span style=\"font-size: 18px; font-family: 宋体;\"></span></p><p>    <span style=\"font-size: 18px; font-family: 宋体, SimSun;\">一、申请使用团队必须为我校部门或学生组织。</span></p><p>    <span style=\"font-size: 18px; font-family: 宋体, SimSun;\">二、预约信息务必填写完整，准确。</span></p><p>    <span style=\"font-size: 18px; font-family: 宋体, SimSun;\">三、如需变更预约申请，请及时联系团委办公室82668564。</span></p><p>    <span style=\"font-size: 18px; font-family: 宋体, SimSun;\">四、使用会议室时请注意室内卫生整洁，爱护公共财产。严禁在会议室吃东西、乱扔垃圾。使用完毕后关门、关电源，防火防盗。</span></p><p>    <span style=\"font-size: 18px; font-family: 宋体, SimSun;\">五、请申请者提前在办公时间（冬季：8:00-12:00，2:00-6:00，夏季：8:00-12:00,2:30-6:30）到团委1号办公室任老师处领取钥匙。（</span><span style=\"font-family: 宋体, SimSun; font-size: 18px;\">备注：领取钥匙的同学须抵押本人一卡通，于钥匙归还时领回。）</span></p><p>    <span style=\"font-size: 18px; font-family: 宋体, SimSun;\">六、如与团委活动冲突，团委活动优先使用。</span></p>'),
(11, '桂厅', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">一、申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、请申请者使用时向思源值班人员出示申请通过界面。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、如有疑问，请及时联系团委办公室82668265。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>\n<p>\n    <br/>\n</p>'),
(12, '会议室102', 2, 0, 1000, '<p style=\"text-align:center;text-indent:19px\"><span style=\"font-size: 19px; font-family: 宋体; color: red;\">会议室使用制度</span></p><p style=\"text-indent: 2em;\">    <span style=\"font-size:19px;font-family:宋体;\">会议室是启德书院为方便同学们进行各项会议而建立的公共场所，为了使同学们的会议活动顺利进行，使用者应注意以下几点：</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">1、为了方便会议室的使用并减少审核人员的负担，需要使用启德十号楼内会议室一（102）、会议室二（323）、会议室三（1023）以及会议室四（1123）的组织或团体需在前一天的22：00之前登录网站apply.tiaozhan.com 进行预约。</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">2、本着先申请，再使用的原则。不允许在未批准的情况下使用会议室。\n</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">3、若预约网站发生崩溃等故障导致无法预约，请于使用前一天在值班时间到小厨房填表预约。</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">4、会议室空闲时间将提供给各位同学自习，自习时请保持安静。为了会议室的使用效果最大化，请自习的同学在离开会议室时带走自己的随身物品，不允许使用个人物品进行占座，公管干事将不定期进入会议室清理无关物品，如有物品丢失后果自负。</span></p>    <p><span style=\"font-size:19px;font-family:宋体\">5、请自觉保持会议室整洁。会议结束后请自觉将桌子、地面清理干净，不留任何纸张文件或其他物品。\n</span></p>   <p><span style=\"font-size:19px;font-family:宋体\">6、不得随意移动桌子、柜子等，移动过的桌子在会后要摆放整齐。</span></p>   <p><span style=\"font-size:19px;font-family:宋体\">7、会议室内的设施、设备未经允许，不得随意带出会议室。若发现会议室的物品有所减少或损坏，请联系会议室负责人。\n</span></p>   <p><span style=\"font-size:19px;font-family:宋体\">8、会议室使用完后请自觉关闭照明、空调等用电设备，避免彻夜亮灯，离开时请随手关门。\n</span></p>'),
