(15, '11楼会议室', 2, 0, 1000, '<p style=\"text-align:center;text-indent:19px\"><span style=\"font-size: 19px; font-family: 宋体; color: red;\">会议室使用制度</span></p><p style=\"text-indent: 2em;\">    <span style=\"font-size:19px;font-family:宋体;\">会议室是启德书院为方便同学们进行各项会议而建立的公共场所，为了使同学们的会议活动顺利进行，使用者应注意以下几点：</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">1、为了方便会议室的使用并减少审核人员的负担，需要使用启德十号楼内会议室一（102）、会议室二（323）、会议室三（1023）以及会议室四（1123）的组织或团体需在前一天的22：00之前登录网站apply.tiaozhan.com 进行预约。</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">2、本着先申请，再使用的原则。不允许在未批准的情况下使用会议室。\n</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">3、若预约网站发生崩溃等故障导致无法预约，请于使用前一天在值班时间到小厨房填表预约。</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">4、会议室空闲时间将提供给各位同学自习，自习时请保持安静。为了会议室的使用效果最大化，请自习的同学在离开会议室时带走自己的随身物品，不允许使用个人物品进行占座，公管干事将不定期进入会议室清理无关物品，如有物品丢失后果自负。</span></p>    <p><span style=\"font-size:19px;font-family:宋体\">5、请自觉保持会议室整洁。会议结束后请自觉将桌子、地面清理干净，不留任何纸张文件或其他物品。\n</span></p>   <p><span style=\"font-size:19px;font-family:宋体\">6、不得随意移动桌子、柜子等，移动过的桌子在会后要摆放整齐。</span></p>   <p><span style=\"font-size:19px;font-family:宋体\">7、会议室内的设施、设备未经允许，不得随意带出会议室。若发现会议室的物品有所减少或损坏，请联系会议室负责人。\n</span></p>   <p><span style=\"font-size:19px;font-family:宋体\">8、会议室使用完后请自觉关闭照明、空调等用电设备，避免彻夜亮灯，离开时请随手关门。\n</span></p>'),
(16, '小厨房', 2, 0, 1000, '<p style=\"text-align:center;text-indent:19px\"><span style=\"font-size: 19px; font-family: 宋体; color: red;\">自助厨房使用制度</span></p>  <p style=\"text-indent: 2em;\">    <span style=\"font-size:19px;font-family:宋体;\">自助厨房位于启德十号楼二层，是启德书院公共财产的一部分，由启德宿生会公共资源管理中心代表书院进行管理，现制定相关管理制度如下：</span></p>  <p><span style=\"font-size:19px;font-family:宋体\">1、自助厨房的一般开放时间为周一至周日的21：00—23:00。单独使用者可在开放时间内登记后进入使用；5—20人的团队需至少提前一天在挑战网apply.tiaozhan.com进行预约申请，并在申请当晚自助厨房值班时间到自助厨房填写《自助厨房预约表》,批准之后将收到自助厨房负责人的短信，则可进行使用。单次预约时间不可超过6小时，值班时间不可进行团队使用。 </span></p>  <p><span style=\"font-size:19px;font-family:宋体\">2、使用前须按照《自助厨房公共物品清单》进行核查，如有不一致需联系当天值班干事，否则追究最后使用者责任。 </span></p>  <p><span style=\"font-size:19px;font-family:宋体\">3、使用时需自备餐具（碗筷等）与洗涤剂（出于卫生安全的考虑，自助厨房仅为同学们提供厨具（刀具除外））。在使用冰箱时，请同学们自觉遵守《冰箱使用规则》。</span></p>  <p><span style=\"font-size:19px;font-family:宋体\">4、使用后使用者须自行清洁所用工具，将物品放回原处，打扫卫生并带走所产生的垃圾，保持厨房的干净整洁。若在使用之前发现室内卫生情况较差，需及时联系相关负责人员进行处理（公管会追究截止当前最后使用者责任）。 </span></p>  <p><span style=\"font-size:19px;font-family:宋体\">5、自助厨房内严禁使用明火或超大功率电器；不允许炒、煎、炸等可能引发危险的烹饪方式；严禁吸烟饮酒等行为；禁止将残余物倾倒入厕所或洗漱台；禁止大声喧哗吵闹。</span></p  <p><span style=\"font-size:19px;font-family:宋体\">6、注意环保，避免浪费，爱惜公共财物，确保室内通风，注意用电安全，使用完毕后关好门窗。若出现卫生问题或发生意外财物事件，将上报书院处理。 </span></p>'),
(17, '电视机', 2, 1, 0, '<p style=\"text-align:center;text-indent:19px\"><span style=\"font-size: 19px; font-family: 宋体; color: red;\">电视机预约制度</span></p>  <p style=\"text-indent: 2em;\">    <span style=\"font-size:19px;font-family:宋体;\">启德十号楼一楼电视机提供给各社团组织进行使用，为了保证电视机使用效率的最大化和使用秩序，现制定以下预约规则：</span></p>  <p><span style=\"font-size:19px;font-family:宋体\">1、需要使用电视机的组织或社团至少提前一天于21:00—23:00到自助厨房登记，并在apply.tiaozhan.com 进行申请，待批准之后即可使用。 </span></p>  <p><span style=\"font-size:19px;font-family:宋体\">2、本着先申请，后使用的原则。未申请的组织或社团不得使用。 </span></p>  <p><span style=\"font-size:19px;font-family:宋体\">3、原则上不允许社团互相交换使用时间，如有紧急情况需要借用其他社团或组织已预约时间，请提前向公管相关负责人说明，否则不诚信记录将记录在之前申请过的组织或社团。 </span></p>'),
(18, '123会议室（20人）', 3, 0, 20, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">一、申请使用团队必须为我书院部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">二、预约信息务必填写完整，准确，真实。如发现本书院同学代替院外组织预约使用，则取消其预约资格并视情况进行处理。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">三、如果取消或变更预约申请，请及时联系<span style=\"color:red\">当天负责人（在通知栏处）</span>。如负责学生无法审核，则提交老师审核。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">四、使用会议室时请注意室内卫生整洁，爱护公共财产。严禁在会议室吃东西、乱扔垃圾。使用完毕后关门、关电源，防火防盗，还原会议室初始状态。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">五、请申请者提前在办公时间（冬季：</span><span style=\"font-size:19px\">8:00-12:00</span><span style=\"font-size: 19px;font-family:宋体\">，</span><span style=\"font-size:19px\">14:00-22:00</span><span style=\"font-size:19px;font-family:宋体\">，夏季：</span><span style=\"font-size:19px\">8:00-12:00,14:30-22:30</span><span style=\"font-size: 19px;font-family:宋体\">）联系当天负责人开门。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">六、使用完成后及时联系办公室锁门。</span>\r\n</p>\r\n<p style=\"text-indent:37px\">\r\n    <span style=\"font-size:19px;font-family:宋体\">备注：申请教室的同学须抵押本人一卡通，于会议室归还时领回。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">七、如与书院活动冲突，书院活动优先使用。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">九、如会议室物品发生损坏，则原价赔偿。</span>\r\n</p>'),
