(22, '127排练厅', 3, 0, 1000, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">一、申请使用团队必须为我书院部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">二、预约信息务必填写完整，准确，真实。如发现本书院同学代替院外组织预约使用，则取消其预约资格并视情况进行处理。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">三、如果取消或变更预约申请，请及时联系<span style=\"color:red\">当天负责人（在通知栏处）</span>。如负责学生无法审核，则提交老师审核。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">四、使用会议室时请注意室内卫生整洁，爱护公共财产。严禁在会议室吃东西、乱扔垃圾。使用完毕后关门、关电源，防火防盗，还原会议室初始状态。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">五、请申请者提前在办公时间（冬季：</span><span style=\"font-size:19px\">8:00-12:00</span><span style=\"font-size: 19px;font-family:宋体\">，</span><span style=\"font-size:19px\">14:00-22:00</span><span style=\"font-size:19px;font-family:宋体\">，夏季：</span><span style=\"font-size:19px\">8:00-12:00,14:30-22:30</span><span style=\"font-size: 19px;font-family:宋体\">）联系当天负责人开门。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">六、使用完成后及时联系办公室锁门。</span>\r\n</p>\r\n<p style=\"text-indent:37px\">\r\n    <span style=\"font-size:19px;font-family:宋体\">备注：申请教室的同学须抵押本人一卡通，于会议室归还时领回。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">七、如与书院活动冲突，书院活动优先使用。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">九、如会议室物品发生损坏，则原价赔偿。</span>\r\n</p>'),
(23, '生活自助室（20人）', 3, 0, 20, '<p style=\"text-align:center;text-indent:19px\">\n<span style=\"font-size: 19px; font-family: 宋体; color: red;\">自助厨房使用制度</span>\n    <!-- <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/> -->\n</p>\n<!-- <p style=\"text-align:center;text-indent:19px\">\n    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span>\n</p> -->\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">一、5—20人的团队需提前一天预约，待审核通过后方可使用。团体使用时间截止至当晚21:00。</span>\n</p>\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">二、使用前须按照《自助厨房公共物品清单》对厨房物品进行核查，如有不一致需联系当天值班干事，否则追究最后使用者责任。</span>\n</p>\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">三、自助厨房提供炊具，使用者需自备餐具与洗涤剂。</span>\n</p>\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">四、自助厨房内严禁使用明火或超大功率电器；严禁吸烟饮酒等行为；禁止大声喧哗吵闹。</span>\n</p>\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">五、使用后使用者须自行清洁所用工具，将物品放回原处，打扫卫生并带走垃圾，离开时须关灯关门。</span>\n</p>\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">六、出现卫生问题或发生意外财物事件，将会上报书院处理。</span>\n</p>'),
(24, '崇实园大厅', 3, 0, 1000, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">一、申请使用团队必须为我书院部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">二、预约信息务必填写完整，准确，真实。如发现本书院同学代替院外组织预约使用，则取消其预约资格并视情况进行处理。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">三、如果取消或变更预约申请，请及时联系<span style=\"color:red\">当天负责人（在通知栏处）</span>。如负责学生无法审核，则提交老师审核。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">四、使用会议室时请注意室内卫生整洁，爱护公共财产。严禁在会议室吃东西、乱扔垃圾。使用完毕后关门、关电源，防火防盗，还原会议室初始状态。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">五、请申请者提前在办公时间（冬季：</span><span style=\"font-size:19px\">8:00-12:00</span><span style=\"font-size: 19px;font-family:宋体\">，</span><span style=\"font-size:19px\">14:00-22:00</span><span style=\"font-size:19px;font-family:宋体\">，夏季：</span><span style=\"font-size:19px\">8:00-12:00,14:30-22:30</span><span style=\"font-size: 19px;font-family:宋体\">）联系当天负责人开门。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">六、使用完成后及时联系办公室锁门。</span>\r\n</p>\r\n<p style=\"text-indent:37px\">\r\n    <span style=\"font-size:19px;font-family:宋体\">备注：申请教室的同学须抵押本人一卡通，于会议室归还时领回。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">七、如与书院活动冲突，书院活动优先使用。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">九、如会议室物品发生损坏，则原价赔偿。</span>\r\n</p>'),
(25, '崇实大厅二楼', 3, 0, 1000, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">一、申请使用团队必须为我书院部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">二、预约信息务必填写完整，准确，真实。如发现本书院同学代替院外组织预约使用，则取消其预约资格并视情况进行处理。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">三、如果取消或变更预约申请，请及时联系<span style=\"color:red\">当天负责人（在通知栏处）</span>。如负责学生无法审核，则提交老师审核。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">四、使用会议室时请注意室内卫生整洁，爱护公共财产。严禁在会议室吃东西、乱扔垃圾。使用完毕后关门、关电源，防火防盗，还原会议室初始状态。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">五、请申请者提前在办公时间（冬季：</span><span style=\"font-size:19px\">8:00-12:00</span><span style=\"font-size: 19px;font-family:宋体\">，</span><span style=\"font-size:19px\">14:00-22:00</span><span style=\"font-size:19px;font-family:宋体\">，夏季：</span><span style=\"font-size:19px\">8:00-12:00,14:30-22:30</span><span style=\"font-size: 19px;font-family:宋体\">）联系当天负责人开门。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">六、使用完成后及时联系办公室锁门。</span>\r\n</p>\r\n<p style=\"text-indent:37px\">\r\n    <span style=\"font-size:19px;font-family:宋体\">备注：申请教室的同学须抵押本人一卡通，于会议室归还时领回。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">七、如与书院活动冲突，书院活动优先使用。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size:19px;font-family:宋体\">九、如会议室物品发生损坏，则原价赔偿。</span>\r\n</p>'),
(26, '崇实后院', 3, 0, 1000, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 14px; font-family: 宋体;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p style=\"text-indent: 19px; text-align: center;\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">冬季：08:30-11:00，14:30-17:30，19:00-22:00</span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">夏季：8:30-11:30、15:00-18:00、19:00-22:00</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">一、申请使用团队必须为我校部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">二、必须为参加人数800人以上，1800人以下的我校学生活动，并且在活动前一周以上申请。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">三、预约信息务必填写完整、准确。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">四、如果取消或变更预约申请，请及时联系团委办公室82668564。&nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、使用宪梓堂时请注意室内卫生整洁及器材的完整性，完好性。爱护共有财产。严禁乱扔垃圾。严禁损坏室内器具。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、场地预约申请成功后，及时在网上办理大型活动审批。并随时关注学校大型活动审批公告。&nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">六，如与学校活动冲突，学校活动优先使用。</span>\r\n</p>'),
(27, '移动投影仪', 3, 1, 0, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 14px; font-family: 宋体;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p style=\"text-indent: 19px; text-align: center;\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">冬季：08:30-11:00，14:30-17:30，19:00-22:00</span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">夏季：8:30-11:30、15:00-18:00、19:00-22:00</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">一、申请使用团队必须为我校部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">二、必须为参加人数800人以上，1800人以下的我校学生活动，并且在活动前一周以上申请。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">三、预约信息务必填写完整、准确。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">四、如果取消或变更预约申请，请及时联系团委办公室82668564。&nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、使用宪梓堂时请注意室内卫生整洁及器材的完整性，完好性。爱护共有财产。严禁乱扔垃圾。严禁损坏室内器具。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、场地预约申请成功后，及时在网上办理大型活动审批。并随时关注学校大型活动审批公告。&nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">六，如与学校活动冲突，学校活动优先使用。</span>\r\n</p>'),
(28, '大厅投影仪', 3, 1, 0, '<p style=\"text-align:center;text-indent:19px\">\n    <span style=\"font-size: 14px; font-family: 宋体;\"></span>\n</p>\n<p style=\"text-align:center;text-indent:19px\">\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\n</p>\n<p style=\"text-align:center;text-indent:19px\">\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\n</p>\n<p style=\"text-indent:19px\">\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\"></span>\n</p>\n<p style=\"text-indent: 19px; text-align: center;\">\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\n</p>\n<p style=\"text-align: center;\">\n    <span style=\"color: rgb(255, 0, 0);\">冬季：08:30-11:00，14:30-17:30，19:00-22:00</span>\n</p>\n<p style=\"text-align: center;\">\n    <span style=\"color: rgb(255, 0, 0);\">夏季：8:30-11:30、15:00-18:00、19:00-22:00</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\"></span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">一、申请使用团队必须为我校部门或学生组织。</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">二、必须为参加人数800人以上，1800人以下的我校学生活动，并且在活动前一周以上申请。</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">三、预约信息务必填写完整、准确。</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">四、如果取消或变更预约申请，请及时联系团委办公室82668564。&nbsp;</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">五、使用宪梓堂时请注意室内卫生整洁及器材的完整性，完好性。爱护共有财产。严禁乱扔垃圾。严禁损坏室内器具。</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">五、场地预约申请成功后，及时在网上办理大型活动审批。并随时关注学校大型活动审批公告。&nbsp;</span>\n</p>\n<p>\n    <span style=\"font-size: 18px;\">六，如与学校活动冲突，学校活动优先使用。</span>\n</p>'),
(29, '大厅电视', 3, 1, 0, '<p style=\"text-align:center;text-indent:19px\">\n<span style=\"font-size: 19px; font-family: 宋体; color: red;\">电视机预约制度</span>\n    <!-- <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/> -->\n</p>\n<!-- <p style=\"text-align:center;text-indent:19px\">\n    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span>\n</p> -->\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">一、需要使用电视机的组织需在使用前一天登录网站预约，每一次的申请时间不得超过五天，每天视频播放时间不得超过半小时。</span>\n</p>\n<p>\n    <span style=\"font-size:19px;font-family:宋体\">二、同一时间申请者不得超过两个，如有两个申请者，后申请者需取得第一个申请者的同意方可使用。</span>\n</p>'),
(30, '大厅音响', 3, 1, 0, '<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 14px; font-family: 宋体;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:19px\">\r\n    <span style=\"font-size: 18px; font-family: 宋体; color: red;\"></span>\r\n</p>\r\n<p style=\"text-indent:19px\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p style=\"text-indent: 19px; text-align: center;\">\r\n    <span style=\"font-size:19px;font-family:宋体;color:red\"></span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">冬季：08:30-11:00，14:30-17:30，19:00-22:00</span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"color: rgb(255, 0, 0);\">夏季：8:30-11:30、15:00-18:00、19:00-22:00</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\"></span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">一、申请使用团队必须为我校部门或学生组织。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">二、必须为参加人数800人以上，1800人以下的我校学生活动，并且在活动前一周以上申请。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">三、预约信息务必填写完整、准确。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">四、如果取消或变更预约申请，请及时联系团委办公室82668564。&nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、使用宪梓堂时请注意室内卫生整洁及器材的完整性，完好性。爱护共有财产。严禁乱扔垃圾。严禁损坏室内器具。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">五、场地预约申请成功后，及时在网上办理大型活动审批。并随时关注学校大型活动审批公告。&nbsp;</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-size: 18px;\">六，如与学校活动冲突，学校活动优先使用。</span>\r\n</p>');
