(31, '文治报告厅', 4, 0, 1000, '<p style=\"text-align:center;text-indent:19px\"><span style=\"font-size: 19px; font-family: 宋体; color: red;\">公共空间使用须知</span>    <!-- <span style=\"font-size: 19px; font-family: 宋体; color: red;\">周一至周五（</span><span style=\"font-size: 19px; color: red;\">08</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">：</span><span style=\"font-size: 19px; color: red;\">00-22:00</span><span style=\"font-size: 19px; font-family: 宋体; color: red;\">）</span><br/> --></p><!-- <p style=\"text-align:center;text-indent:19px\">    <span style=\"font-size:19px;font-family:宋体;color:red\">周六周日（</span><span style=\"font-size:19px;color:red\">8:30-11:30,14:30-17:30,19:00-22:00</span><span style=\"font-size:19px;font-family:宋体;color:red\">）</span></p> --><p style=\"text-indent: 2em;\">    <span style=\"font-size:19px;font-family:宋体;\">文治报告厅、健身房、党团活动时、大排练厅、小排练厅属公共场所，为了给大家提供一个整洁的环境，方便自己与他人，请遵守以下约定：</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">一、请勿在23:00以后使用公共空间；</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">二、请勿在公共空间留存任何个人物品</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">三、请尽量保持公共空间整洁，做讲卫生的文治人。</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">说明：</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">（1）23:00以后为公共空间打扫时间，在打扫时会终止公共空间使用并清理一切非公共空间物品；</span></p><p>    <span style=\"font-size:19px;font-family:宋体\">（2）如有社团或个人在公共空间存放物品的请在本周五前清理，周五后将正是清理非公共空间物品。</span></p><p style=\"text-align: right;\">    <span style=\"font-size:19px;font-family:宋体\">文治书院公共空间打扫小组</span></p><p style=\"text-align: right;\">    <span style=\"font-size:19px;font-family:宋体\">2015年9月21日</span></p>'),
