(53, '107会议室（50人）', 10, 0, 50, '会议室使用制度</br></br>\n\n会议室是仲英书院为方便同学们进行各项会议而建立的公共场所，为了使同学们的会议活动顺利进行，使用者应注意以下几点：</br></br>\n\n1、为了方便会议室的使用并减少审核人员的负担，需要会议室的组织或团体需在前三天的22：00之前登录网站apply.tiaozhan.com 进行预约。（例如：周五使用，请最迟于周二晚22:00前申请）</br></br>\n\n2、本着先申请，再使用的原则。不允许在未批准的情况下使用会议室。</br></br>\n\n3、若预约网站发生崩溃等故障导致无法预约，请联系丁同学 135-7292-0073 。</br></br>\n\n4、由于书院楼宇有专门的自习区域，因此，会议室仅作为会议使用，不作为自习场所对外开放。</br></br>\n\n5、请自觉保持会议室整洁。会议结束后请自觉将桌子、地面清理干净，不留任何纸张文件或其他物品。</br></br>\n\n6、不得随意移动桌子、柜子等，移动过的桌子在会后要摆放整齐。</br></br>\n\n7、会议室内的设施、设备未经允许，不得随意带出会议室。若发现会议室的物品有所减少或损坏，请联系会议室负责人。</br></br>\n\n8、会议室使用完后请自觉关闭照明、空调等用电设备，避免彻夜亮灯，离开时请随手关门。</br></br>\n\n9、会议室使用申请通过后，会有专人提前5分钟开门，如门未开，请联系丁同学 135-7292-0073。</br>'),
(54, '122会议室（15人）', 10, 0, 15, '会议室使用制度</br></br>\r\n\r\n会议室是仲英书院为方便同学们进行各项会议而建立的公共场所，为了使同学们的会议活动顺利进行，使用者应注意以下几点：</br></br>\r\n\r\n1、为了方便会议室的使用并减少审核人员的负担，需要会议室的组织或团体需在前三天的22：00之前登录网站apply.tiaozhan.com 进行预约。（例如：周五使用，请最迟于周二晚22:00前申请）</br></br>\r\n\r\n2、本着先申请，再使用的原则。不允许在未批准的情况下使用会议室。</br></br>\r\n\r\n3、若预约网站发生崩溃等故障导致无法预约，请联系丁同学 135-7292-0073 。</br></br>\r\n\r\n4、由于书院楼宇有专门的自习区域，因此，会议室仅作为会议使用，不作为自习场所对外开放。</br></br>\r\n\r\n5、请自觉保持会议室整洁。会议结束后请自觉将桌子、地面清理干净，不留任何纸张文件或其他物品。</br></br>\r\n\r\n6、不得随意移动桌子、柜子等，移动过的桌子在会后要摆放整齐。</br></br>\r\n\r\n7、会议室内的设施、设备未经允许，不得随意带出会议室。若发现会议室的物品有所减少或损坏，请联系会议室负责人。</br></br>\r\n\r\n8、会议室使用完后请自觉关闭照明、空调等用电设备，避免彻夜亮灯，离开时请随手关门。</br></br>\r\n\r\n9、会议室使用申请通过后，会有专人提前5分钟开门，如门未开，请联系丁同学 135-7292-0073。</br>\r\n'),
(55, '西区活动中心一楼健身房', 5, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">一、申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、预约信息务必填写完整，准确。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、请申请者使用时向值班人员出示申请通过界面。</span>\n</p>\n<p style=\"text-indent:0;line-height:normal;background:white\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、如有疑问，请及时联系团委办公室82668265。</span>\n</p>\n<p style=\"text-indent: 0px; line-height: normal; background: white;\">\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\n</p>'),
(56, '思源学生活动中心主场地', 1, 0, 1000, '<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\"></span>\r\n</p>\r\n<p style=\"margin-left:0;text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family:宋体;color:#333333\">一、</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">申请使用必须为校内正式单位和学生组织，使用人员为校内人员，校外人员必须另行申请报备。</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">二、活动规模原则上必须符合大型活动要求，并在OA办理大型活动审批。</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">三、预约信息务必填写完整，准确。</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">四、申请人在申请后或通过如取消活动均必须完成线上取消，如变更请线上取消后另行申请。（可以在申请后或通过如取消活动）</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">五、使用时请严格保障场内安全、维持卫生整洁，爱护公共财产，严禁私接及随意使用场内各类设备。</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">六、<strong>申请及使用时，请务必提前和团委联系。</strong> 梁老师 齐老师82668265</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">七、如与学校临时重要活动冲突，学校优先使用</span><span style=\"font-family: 宋体;color: rgb(51, 51, 51)\">。</span>\r\n</p>\r\n<p style=\"text-indent:0;line-height:normal;background:white\">\r\n    <span style=\"font-size:16px;line-height:120%;font-family:宋体;color:#333333;background:white\"></span><br/>\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>');
